import i18n from 'i18next';
import { initReactI18next } from 'react-i18next';

const resources = {
  en: {
    translation: {
      login: 'Login',
      email: 'Email',
      password: 'Password',
      submit: 'Submit',
      tickets: 'Tickets',
      create_ticket: 'Create Ticket',
      logout: 'Logout',
    },
  },
  ru: {
    translation: {
      login: 'Вход',
      email: 'Эл. почта',
      password: 'Пароль',
      submit: 'Отправить',
      tickets: 'Заявки',
      create_ticket: 'Создать заявку',
      logout: 'Выйти',
    },
  },
  fr: {
    translation: {
      login: 'Connexion',
      email: 'Email',
      password: 'Mot de passe',
      submit: 'Envoyer',
      tickets: 'Tickets',
      create_ticket: 'Créer un ticket',
      logout: 'Déconnexion',
    },
  },
  de: {
    translation: {
      login: 'Anmelden',
      email: 'E-Mail',
      password: 'Passwort',
      submit: 'Absenden',
      tickets: 'Tickets',
      create_ticket: 'Ticket erstellen',
      logout: 'Abmelden',
    },
  },
};

i18n.use(initReactI18next).init({
  resources,
  lng: 'en',
  interpolation: {
    escapeValue: false,
  },
});

export default i18n;
